import React from 'react';
import ReactDOM from 'react-dom';
import {BrowserRouter, Link}  from "react-router-dom";



import App from './App';

ReactDOM.render(
  <BrowserRouter>
  <Link to="/Admin">  <Admin/>     </Link>
  <Link to="/home">   <App/>        </Link>

  </BrowserRouter>
 ,
  document.getElementById('root')
);
